657—39.11(155A) Vaccine administration by pharmacists—statewide protocol. Rescinded ARC
6076C, IAB 12/15/21, effective 1/19/22.{quote}

{quote}Vaccine: A preparation that is used to stimulate the body’s immune response against diseases.{quote}

The term _immunity_ is missing from WHO’s definition of a vaccine.

Since August 2021 a vaccine is not required to produce immunity any more, by definition, according to the CDC.
